import React from "react";
import { Navigate, Outlet } from "react-router-dom";

const PrivateRootAdmin = ({ dataLog }) => {
  return <>{dataLog.role == "admin" ? <Outlet /> : <Navigate to="/" />}</>;
};

export default PrivateRootAdmin;
